import React from 'react';
import '../../components/common/TopRankPageLayout.css';
import './TopPlaces.css';
import Navbar from '../../components/common/navbarPage';
// import styled from 'styled-components';

function topprovince() {
    return (
        <div class="top layout placeBox">
            <Navbar />
            <div class="BGimg" />
            <div class="LayOut">
                <div class="PageTitle">Popular Places</div>
                <div class="PageBreadCrumbs">Home&emsp;|&emsp;Popular Places</div>
            </div>
        </div>
    );
}

export default topprovince;
